    false,nt"url": null,nt"notes": "NODC accession 0113814 includes physical
    and underway data collected aboard the ATLANTIS during cruise AT15-09 in the North
    Pacific Ocean from 2006-08-25 to 2006-09-11. These data include CURRENT SPEED -
    EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
    used to collect these data include ADCP and GPS. These data were collected by Deborah
    Kelley of University of Washington, and by Woods Hole Oceanographic Institution
    as part of Determining the Limits to Life in Submarine Hydrothermal Systems. The
    Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part of
    the NSF sponsored Rolling Deck to Repository (R2R) program. The ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
    not available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
